import React from 'react';

export default function Navbar(){
    return(
        <div className = "navigation-bar">
            <figure className = "navigation-bar-logo">
                <img className = "navigation-bar-image" alt = "Airbnb logo" src = "https://media.designrush.com/inspiration_images/135187/conversions/_1511452487_364_Airbnb-mobile.jpg"/>
            </figure>
        </div>
    )
}
